import React from 'react'
import { Routes, Route } from "react-router-dom";
import Product from "./pages/products";
import {ToastContainer, toast } from "react-toastify";

const App = () => {
  return (
    <div className="App">
      <ToastContainer
      position="top-right"
      autoClose={5000}
      hideProgressBar={false}
      newestOnTop={false}
      closeOnClick
      rtl={false}
      pauseOnFocusLoss
      draggable
      pauseOnHover
      theme="light"
     
      />
    <Routes>
      <Route path="/" element={<Product/>} />

    </Routes>
  </div>
  )
}

export default App
